import React, { useState } from 'react';
import './RangeProgressBar.scss';

const RangeProgressBar: React.FC = () => {
  const [selectedRange, setSelectedRange] = useState<[number, number]>([0, 0]);
  const maxRange = 100; // 최대 범위 설정

  const handleRangeClick = (range: [number, number]) => {
    setSelectedRange(range);
  };

  const renderRanges = () => {
    const ranges = [];

    for (let i = 0; i <= maxRange; i += 10) {
      const rangeStart = i;
      const rangeEnd = i + 10;
      const isActive =
        rangeStart >= selectedRange[0] && rangeEnd <= selectedRange[1];

      ranges.push(
        <div
          key={i}
          className={`range ${isActive ? 'active' : ''}`}
          onClick={() => handleRangeClick([rangeStart, rangeEnd])}
        >
          {`${rangeStart}% - ${rangeEnd}%`}
        </div>,
      );
    }

    return ranges;
  };

  return <div className="range-progress-bar">{renderRanges()}</div>;
};

export default RangeProgressBar;
